INSERT INTO `global_rule` VALUES (1, 'depend', '业务流用例的依赖关系字段', 'path ：json中目标字段的路径      caseId ：依赖的业务流用例的序号  keyValue ：依赖用例response字段的路径  valueType：非必填，参数化字段福祉类型，当取值与赋值类型不一致时填写', '{\n    \"depends\":[\n        {\n            \"path\":\"参数化字段的路径：$.depends[0].path\",\n            \"valueType\":\"参数化字段的类型：string/int/long\",\n            \"caseId\":0,\n            \"keyValue\":\"参数化取值的字段名：$.id\"\n        },\n        {\n            \"path\":\"\",\n            \"caseId\":2,\n            \"keyValue\":\"\"\n        }\n    ]\n}');
INSERT INTO `global_rule` VALUES (2, 'randKey', '随机参数字段', 'path ：json中目标字段的路径      type：随机参数类型【1：数字，2：字母和数字】  num：参数长度', '{\n    \"randKeys\":[\n        {\n            \"path\":\"目标字段路径：$.name\",\n            \"title\":\"字符串自定义标签[type=2时生效，非必要字段]\",\n            \"type\":2,\n            \"num\":5\n        },\n        {\n            \"path\":\"$.code\",\n            \"type\":1,\n            \"num\":12\n        }\n    ]\n}	{\"path\":\"\",\"type\":2,\"num\":5},\r\n	{\"path\":\"$.code\",\"type\":1,\"num\":12}\r\n]\r\n}');
INSERT INTO `global_rule` VALUES (3, 'beforeSql', '前置操作：sql处理', 'sql：要执行的参数  path ：json中目标字段的路径  keyName ：sql返回结果对应字段  【当前仅支持单挑查询结果的替换，paths为空时则只负责执行】  valueType：非必填，参数化字段福祉类型，当取值与赋值类型不一致时填写', '{\n    \"sql\":\"delete FROM nextop_warehouse_location where code = \'X-3-9\';\",\n    \"paths\":[\n        {\n            \"path\":\"字段路径，例如：$.paths[0].path\",\n            \"valueType\":\"参数化字段的类型：string/int/long\",\n            \"keyName\":\"sql结果的字段名\"\n        }\n    ]\n}');
INSERT INTO `global_rule` VALUES (4, 'assertion', '用例response断言', 'path ：json中目标字段的路径  keyValue : 预期结果  checkType:比较方式【equals/start/end/contains】', '{\n    \"assertion\":[\n        {\n            \"path\":\"取值字段的路径：$.code\",\n            \"keyValue\":\"000000\",\n            \"checkType\":\"equals\"\n        },\n        {\n            \"path\":\"$.msg\",\n            \"keyValue\":\"操作成功\",\n            \"checkType\":\"start\"\n        }\n    ]\n}');
INSERT INTO `global_rule` VALUES (5, 'afterDBCheck', '用例其他断言操作：数据库等', 'path ：json中目标字段的路径  keyValue ：sql返回结果对应字段【当前仅支持单条查询结果的替换，paths为空时则只负责执行】   checkType:比较方式【equals/start/end/contains】', '{\n    \"sql\":\"sql语句\",\n    \"paths\":[\n        {\n            \"path\":\"取值字段路径：$.code\",\n            \"keyValue\":\"sql结果取值名称\",\n            \"checkType\":\"equals/start/end/contains\"\n        }\n    ]\n}');
INSERT INTO `global_rule` VALUES (6, 'afterSql', '用例后置操作：数据库恢复等', 'sqls ：需要执行的sql', '{\"sqls\":[\"\", \"\"]}');
